import React, {useEffect, useState} from 'react';
import PartnerComp from "./partnerComp";
import Button from "../layout/container/button";
import axios from "axios";
import PartElem from "../../componets/partner/part_elem";

const PartnersAdmin = () => {
    const [partner, SetPatner] = useState([])
    useEffect(() => {
        axios.get('http://127.0.0.1:8000/partners/').then((res)=>{
            SetPatner(res.data)
        })
    }, []);
    return (
        <div className="flex-wrap items-start flex">
            <div className="w-[960px] h-fit justify-start items-center gap-4 inline-flex ml-[15px] mt-[15px] flex-wrap ">
                {partner.map(item=>
                    <PartnerComp data={[item.partner_name,item.partner_desc,item.partner_logo]}/>
                )}
            </div>
            <Button onclick={partner.push([])} data="партнера"/>

        </div>
    );
};

export default PartnersAdmin;
